import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useLocation, useNavigate, Link } from 'react-router-dom';

function ResetPasswordPage() {
  const location = useLocation();
  const navigate = useNavigate();
  const [token, setToken] = useState(null);
  const [newPassword, setNewPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [message, setMessage] = useState('');
  const [error, setError] = useState('');
  const [resetSuccess, setResetSuccess] = useState(false);

  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const receivedToken = params.get('token');
    if (receivedToken) {
      setToken(receivedToken);
    } else {
      setError("Token za resetovanje lozinke nije pronađen u URL-u.");
    }
  }, [location.search]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setMessage('');
    setError('');

    if (!token) {
      setError("Token za resetovanje lozinke nedostaje.");
      return;
    }

    if (newPassword !== confirmPassword) {
      setError("Lozinke se ne podudaraju.");
      return;
    }

    try {
       const response = await axios.post(
              'http://localhost:8081/auth/reset-password',
              { token: token, newPassword: newPassword },
              {
                  headers: {
                      'Content-Type': 'application/json'
                  }
              }
            );
      setMessage(response.data);
      setError('');
      setResetSuccess(true);

    } catch (err) {
      if (err.response) {
        setError(err.response.data.message || err.response.data.error || "Došlo je do greške prilikom resetovanja lozinke.");
      } else {
        setError("Došlo je do greške prilikom resetovanja lozinke.");
      }
    }
  };

  return (
    <div className="container mt-5">
      <div className="row justify-content-center">
        <div className="col-md-6">
          <div className="card">
            <div className="card-header text-center bg-danger text-white">
              <h2>Resetovanje lozinke</h2>
            </div>
            <div className="card-body">
              {message && <div className="alert alert-success">{message}</div>}
              {error && <div className="alert alert-danger">{error}</div>}

              {}
              {resetSuccess ? (
                  <div className="text-center">
                      <p>Lozinka je uspješno resetovana!</p>
                      <Link to="/login" className="btn btn-danger mt-3">Nazad na prijavu</Link>
                  </div>
              ) : token ? (
                <form onSubmit={handleSubmit}>
                  <div className="mb-3">
                    <label htmlFor="newPasswordInput" className="form-label">Nova lozinka</label>
                    <input
                      type="password"
                      className="form-control"
                      id="newPasswordInput"
                      value={newPassword}
                      onChange={(e) => setNewPassword(e.target.value)}
                      required
                    />
                  </div>
                  <div className="mb-3">
                    <label htmlFor="confirmPasswordInput" className="form-label">Potvrdite novu lozinku</label>
                    <input
                      type="password"
                      className="form-control"
                      id="confirmPasswordInput"
                      value={confirmPassword}
                      onChange={(e) => setConfirmPassword(e.target.value)}
                      required
                    />
                  </div>
                  <div className="d-grid gap-2">
                    <button type="submit" className="btn btn-danger">Resetuj lozinku</button>
                  </div>
                </form>
              ) : (
                <p className="text-center">Molimo Vas da pratite link iz emaila za resetovanje lozinke.</p>
              )}
              {}
              {!resetSuccess && <Link to="/login" className="text-center text-danger mt-3 d-block">Nazad na prijavu</Link>}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ResetPasswordPage;
